[{"name": "mcp__togomcp__get_sparql_example", "input": {"dbname": "mediadive"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "mediadive", "sparql_query": "
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>
PREFIX cas: <https://identifiers.org/cas:>

SELECT ?ingredient ?label ?cas
WHERE {
  ?ingredient a <http://purl.jp/bio/101/mediadive/Ingredient> ;
              rdfs:label ?label .
  FILTER(CONTAINS(LCASE(?label), "glucose"))
  OPTIONAL { ?ingredient <http://purl.jp/bio/101/mediadive/cas> ?cas }
}
LIMIT 10
"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "mediadive"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "mediadive", "sparql_query": "PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT ?ingredient ?label ?cas
FROM <http://rdfportal.org/dataset/mediadive>
WHERE {
  ?ingredient a schema:Ingredient ;
              rdfs:label ?label .
  ?label bif:contains "'glucose'"
  OPTIONAL { ?ingredient schema:hasCAS ?cas }
}
LIMIT 10"}}]

[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "bacdive", "sparql_query": "
PREFIX bd: <http://bacdive.dsmz.de/ontology/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT (COUNT(DISTINCT ?strain) AS ?count)
WHERE {
  ?strain a bd:Strain ;
          bd:hasTaxonomy ?taxonomy .
  ?taxonomy bd:genus "Streptomyces" .
}
"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "bacdive"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "bacdive", "sparql_query": "
PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT (COUNT(DISTINCT ?strain) AS ?count)
FROM <http://rdfportal.org/dataset/bacdive>
WHERE {
  ?strain a schema:Strain ;
          schema:hasGenus ?genus .
  FILTER(CONTAINS(LCASE(?genus), "streptomyces"))
}
"}}]

[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX taxon: <http://purl.uniprot.org/taxonomy/>

SELECT (COUNT(DISTINCT ?protein) AS ?count)
WHERE {
  ?protein a up:Protein ;
           up:reviewed true ;
           up:organism taxon:9606 .
}
"}}]
